// PaymentStrategy.js

// Interface for payment strategies
class PaymentStrategy {
    pay(amount) {
        throw new Error('This method must be overridden');
    }
}

export class DirectPaymentStrategy extends PaymentStrategy {
    pay(amount) {
        // Logic for direct payment
        console.log(`Direct payment of ${amount} units`);
    }
}

export class PayPalPaymentStrategy extends PaymentStrategy {
    pay(amount) {
        // Logic for PayPal payment
        console.log(`PayPal payment of ${amount} units`);
    }
}
